initCode:
(obj) => {
        obj.bg = 'linear-gradient(0deg,#8a4c69,#c45123)';
        for (let i = 0; i < obj.symbols.length; i++) {
            let l = obj.symbols[i];
            l.size = 72;
            l.x = (-(obj.symbols.length * 36) / 2 + 18) + i * 36;
            l.y = -250;
        }
    }
